import React from "react";
import { Route, Switch } from "react-router";
import CardList from "./components/CardList.jsx";
import layoutsimple from "./components/layoutsimple";
import startpage from "./components/startpage";
import ImageListPage from "./components/ImageListPage";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route
          path="/Image/:id"
          render={(props) => {
            return (
              <layoutsimple>
                <ImageListPage {...props} />
              </layoutsimple>
            );
          }}
        ></Route>

        <Route path="/ImageList">
          <layoutsimple>
            <ImageListPage />
          </layoutsimple>
        </Route>

        <Route path="/">
          <layoutsimple>
            <h1>Hej</h1>
            <Startpage />
          </layoutsimple>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
